#include <bits/stdc++.h>
using namespace std;
#define faster() ios_base::sync_with_stdio(false);cin.tie();cout.tie();
#define matrix vector <vector<long long>>
#define MOD 1000000007
#define el "\n"
const long long big = 1e6;

int n, check;
vector <long long> binary(100,0);

void initiate() {
	for (int i = 0 ; i < n ; i++)
	{
		binary[i] = 0;
	}
}

int binaryGen() {
    int i = n - 1;
    while ( i >= 0 && binary[i] == 1 )
	{
		binary[i] = 0;
        i--;
	}
    if ( i == -1 ) return -1;
    else binary[i] = 1;
    return 0;
}

void print() {
	for (int i = 0 ; i < n ; i++)
	{
		cout << binary[i];
	}
	cout << " ";
}

int main() {
	faster();
	int t;
	cin >> t;
	while ( t-- )
	{
		check = 0;
		cin >> n;
		initiate();
		do
		{
			print();
			check = binaryGen();
		}
		while ( check == 0 );
		if ( t != 0 )
		{
			cout << endl;
		}
	}
}

